import React from 'react';
import './App.css';
import { List } from './styles';

const ListWrapper = (props) => {
	let data = props.searchResult.length > 0 ? props.searchResult : props.players;
	console.log(data);
	return (
		<List data-testid="list-of-players">
			data.map(player => (
			<li key={player.id}>
				<p>{player.name}</p>
				<button
					className="hashtag"
					onClick={() => props.filterByCountry(player.country)}
				>
					#{player.country.toLowerCase()}
				</button>
			</li>
			))
			{props.searchResult.length > 0
				? props.searchResult.map((player) => (
						<li key={player.id}>
							<p>{player.name}</p>
							<button
								className="hashtag"
								onClick={() => props.filterByCountry(player.country)}
							>
								#{player.country.toLowerCase()}
							</button>
						</li>
				  ))
				: props.players.map((player) => (
						<li key={player.id}>
							<p>{player.name}</p>
							<button
								className="hashtag"
								onClick={() => props.filterByCountry(player.country)}
							>
								#{player.country.toLowerCase()}
							</button>
						</li>
				  ))}
		</List>
	);
};

export default ListWrapper;
